import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./Components/Header";

function App() {
  return (
    <Router basename={process.env.PUBLIC_URL}>
      <Header />
      <Routes>
        <Route path="/*"></Route>
        <Route path="/tv/*"></Route>
        <Route path="/search/*"></Route>
      </Routes>
    </Router>
  );
}

export default App;
